import React, { useEffect, useState } from "react";
import styles from "./About.css";

function About() {
  return (
    <div className="container-about">
      <div className="title">
        <h1>About Us</h1>
        <p className="history">this is our history</p>
      </div>
    </div>
  );
}

export default About;
